func GetFullName() string {
	var xing = getXing()
	var ming = getMing()
	var lastNameLen = len(xing)
	var firstNameLen = len(ming)
	rand.Seed(time.Now().UnixNano())     //设置随机数种子
	var first = ming[rand.Intn(firstNameLen)]                     //名

	//返回姓名
	return fmt.Sprintf("%s%s", xing[rand.Intn(lastNameLen)], first)
}

